import React, {useState} from "react";
import './TrackList.css';

const TrackList = (props) => {
    const [tracks, setTracks] = useState();
    setTracks(props.tracks);
    console.log(typeof(tracks));
    return (
        <div class="TrackList">
            {tracks ? <h1>tracks[0]</h1> : ''};
        </div>
    )
}

export { TrackList };
